/// attribute : [{"name":"Matches","value":"17","win_basis":"Highest Value","win_points":"10"},{"name":"Balls","value":"344","win_basis":"Highest Value","win_points":"11"},{"name":"Runs","value":"498","win_basis":"Highest Value","win_points":"20"},{"name":"Wickets","value":"12","win_basis":"Highest Value","win_points":"15"},{"name":"Economy","value":"8.69","win_basis":"Lowest Value","win_points":"15"},{"name":"4WI","value":"0","win_basis":"Lowest Value","win_points":"10"}]

class Cards {
  String _cardName;
  String _cardImg;
  String _nationality;
  String _flagImage;
  List<Attribute> _attribute;

  String get cardName => _cardName;
  String get cardImg => _cardImg;
  String get nationality => _nationality;
  String get flagImage => _flagImage;
  List<Attribute> get attribute => _attribute;

  Cards({
      String cardName, 
      String cardImg, 
      String nationality, 
      String flagImage, 
      List<Attribute> attribute}){
    _cardName = cardName;
    _cardImg = cardImg;
    _nationality = nationality;
    _flagImage = flagImage;
    _attribute = attribute;
}

  Cards.fromJson(dynamic json) {
    _cardName = json["card_name"];
    _cardImg = json["card_img"];
    _nationality = json["nationality"];
    _flagImage = json["flag_image"];
    if (json["attribute"] != null) {
      _attribute = [];
      json["attribute"].forEach((v) {
        _attribute.add(Attribute.fromJson(v));
      });
    }
  }

  Map<String, dynamic> toJson() {
    var map = <String, dynamic>{};
    map["card_name"] = _cardName;
    map["card_img"] = _cardImg;
    map["nationality"] = _nationality;
    map["flag_image"] = _flagImage;
    if (_attribute != null) {
      map["attribute"] = _attribute.map((v) => v.toJson()).toList();
    }
    return map;
  }

}

/// name : "Matches"
/// value : "17"
/// win_basis : "Highest Value"
/// win_points : "10"

class Attribute {
  String _name;
  String _value;
  String _winBasis;
  String _winPoints;

  String get name => _name;
  String get value => _value;
  String get winBasis => _winBasis;
  String get winPoints => _winPoints;

  Attribute({
      String name, 
      String value, 
      String winBasis, 
      String winPoints}){
    _name = name;
    _value = value;
    _winBasis = winBasis;
    _winPoints = winPoints;
}

  Attribute.fromJson(dynamic json) {
    _name = json["name"];
    _value = json["value"];
    _winBasis = json["win_basis"];
    _winPoints = json["win_points"];
  }

  Map<String, dynamic> toJson() {
    var map = <String, dynamic>{};
    map["name"] = _name;
    map["value"] = _value;
    map["win_basis"] = _winBasis;
    map["win_points"] = _winPoints;
    return map;
  }

}